{"jack":1,"jack2":2}
{"jack":2,"jack2":3}
''';

set savePath="/tmp/jack";

load jsonStr.`rawData` as table1;

save overwrite table1 as csv.`${savePath}` where header="true";

load csv.`${savePath}` as table2 where header="true";

