guide/et/repartition_table.html.body:
Change the partitions of table
In many situations, we need to change the partitions, e.g. before we save the data, we want the table will have only on file
or we use python, we hope the python worker should be more, and you can use RepartitionExt to help you achieve it.
set jsonStr = '''
{"id":0,"parentId":null}
{"id":1,"parentId":null}
{"id":2,"parentId":1}
{"id":3,"parentId":3}
{"id":7,"parentId":0}
{"id":199,"parentId":1}
{"id":200,"parentId":199}
{"id":201,"parentId":199}
''';

load jsonStr.`jsonStr` as data;

run data as RepartitionExt.`` where partitionNum="2" 
as newdata;

And the table newdata now have only 2 partitions.

guide/et/email.html.body:
How to send mail
After the etl job finishing, we should push a notice to people.
You can use SendMessage to achieve this target:

set EMAIL_TITLE = "subject";
set EMAIL_BODY = `select download_url from t1` options type = "sql";
set EMAIL_TO = "";

select "${EMAIL_BODY}" as content as data;

run data as SendMessage.``
where method="mail"
and to = "${EMAIL_TO}"
and subject = "${EMAIL_TITLE}"
and smtpHost = "xxxxxxxx";

Another example:

select download_csv_url("${DATA_FILE_PATH}") as download_url
as t1;


set EMAIL_TITLE = "这是邮件标题";
set EMAIL_BODY = `select download_url from t1` options type = "sql";
set EMAIL_TO = "";

select "${EMAIL_BODY}" as content as data;

run data as SendMessage.``
where method="mail"
and to = "${EMAIL_TO}"
and subject = "${EMAIL_TITLE}"
and smtpHost = "xxxxxxxx";

download_csv_url is a udf which can generate a download url.

guide/udf/scala-udf.html.body:
Scala UDF
Example：
set plusFun='''

def apply(a:Double,b:Double)={
   a + b
}

''';

-- load script as a table, every thing in mlsql should be table which 
-- can be process more convenient.
load script.`plusFun` as scriptTable;

-- register `apply` as UDF named `plusFun` 
register ScriptUDF.`scriptTable` as plusFun
;

-- create a data table.
set data='''
{"a":1}
{"a":1}
{"a":1}
{"a":1}
''';
load jsonStr.`data` as dataTable;

-- using echoFun in SQL.
select plusFun(1,2) as res from dataTable as output;

Write the code in register statement：
register ScriptUDF.`` as plusFun where
and lang="scala"
and udfType="udf"
code='''
def apply(a:Double,b:Double)={
   a + b
}
''';

guide/udf/scala-udaf.html.body:
Scala UDAF
Example：
set plusFun='''
import org.apache.spark.sql.expressions.{MutableAggregationBuffer, UserDefinedAggregateFunction}
import org.apache.spark.sql.types._
import org.apache.spark.sql.Row
class SumAggregation extends UserDefinedAggregateFunction with Serializable{
    def inputSchema: StructType = new StructType().add("a", LongType)
    def bufferSchema: StructType =  new StructType().add("total", LongType)
    def dataType: DataType = LongType
    def deterministic: Boolean = true
    def initialize(buffer: MutableAggregationBuffer): Unit = {
      buffer.update(0, 0l)
    }
    def update(buffer: MutableAggregationBuffer, input: Row): Unit = {
      val sum   = buffer.getLong(0)
      val newitem = input.getLong(0)
      buffer.update(0, sum + newitem)
    }
    def merge(buffer1: MutableAggregationBuffer, buffer2: Row): Unit = {
      buffer1.update(0, buffer1.getLong(0) + buffer2.getLong(0))
    }
    def evaluate(buffer: Row): Any = {
      buffer.getLong(0)
    }
}
''';


--load script
load script.`plusFun` as scriptTable;
--register
register ScriptUDF.`scriptTable` as plusFun options
className="SumAggregation"
and udfType="udaf"
;

set data='''
{"a":1}
{"a":1}
{"a":1}
{"a":1}
''';
load jsonStr.`data` as dataTable;

-- 使用plusFun
select a,plusFun(a) as res from dataTable group by a as output;

You also can do like this:
set plusFun='''
class A {

    def apply(a:Double,b:Double)={
       a + b
    }

    def hello(a:String)={
       s"hello: ${a}"
    }
}
''';


load script.`plusFun` as scriptTable;
register ScriptUDF.`scriptTable` as plusFun where methodName="apply" and className="A";
register ScriptUDF.`scriptTable` as helloFun options
methodName="hello"  and className="A";


-- using echoFun in SQL.
select plusFun(1,2) as plus, helloFun("jack") as jack as output;

guide/udf/java-udf.html.body:
Java UDF
Example:
set echoFun='''
import java.util.HashMap;
import java.util.Map;
public class UDF {
  public Map apply(String s) {
    Map m = new HashMap<>();
    Integer[] arr = {1};
    m.put(s, arr);
    return m;
  }
}
''';

load script.`echoFun` as scriptTable;

register ScriptUDF.`scriptTable` as funx
options lang="java"
;

-- create a data table.
set data='''
{"a":"a"}
''';
load jsonStr.`data` as dataTable;

select funx(a) as res from dataTable as output;

Notice:


The source code must be a class
package name is not allowed


Example2:
set echoFun='''
import java.util.HashMap;
import java.util.Map;
public class Test {
    public Map test(String s) {
      Map m = new HashMap<>();
      m.put(s, s);
      return m;
  }
}
''';

load script.`echoFun` as scriptTable;

register ScriptUDF.`scriptTable` as funx
options lang="java"
and className = "Test"
and methodName = "test"
;

-- create a data table.
set data='''
{"a":"a"}
''';
load jsonStr.`data` as dataTable;

select funx(a) as res from dataTable as output;
